// ==UserScript==
// @name         Find on SukebeiNya
// @namespace    MALFindSukebeiNya
// @version      1.3
// @description  Will open nyaa on a new window and search for the anime title
// @author       Samu, Fuchisa
// @match        https://myanimelist.net/anime/*
// @match        https://myanimelist.net/anime.php?id=*
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/419068/Find%20on%20SukebeiNya.user.js
// @updateURL https://update.greasyfork.org/scripts/419068/Find%20on%20SukebeiNya.meta.js
// ==/UserScript==

(function() {
  'use strict';

  /**
    icon source
    https://icons8.com/icon/82838/external-link
    https://ezgif.com/image-to-datauri
  **/

  //** SETTINGS **//
  var sortBy = "seeders";                       // "comments", "size", "id", "seeders", "leechers", or "downloads"
  var filter = "0";                             // 0 = No Filter || 1 = No remakes || 2 = Trusted Only
  var category = "Anime";      // Check values below
  var favoriteGroups = ["Judas", "Erai-raws"];  //List is ordered, favorite should be first
  //** END OF SETTINGS **//

  var cat = {
    Allcategories: "0_0",
    Art: "1_0",
    Anime: "1_1",
    Doujinshi: "1_2",
    Games: "1_3",
    Manga: "1_4",
    Pictures: "1_5",
    RealLife: "2_0",
    PhotobooksandPicture: "2_1",
    Videos: "2_2"
  }


  var textFragment = ":~:text=" + favoriteGroups.join("&text=");
  var titleElem = document.querySelector(".title-name");
  var title = titleElem.textContent.replace(/[^a-zA-Z0-9]+/g, "+");
  var nyaaButton = document.createElement("a");

  var path = `?f=${filter}&c=${cat[category]}&s=${sortBy}&o=desc&q=${encodeURI(title.trim())}`;

  nyaaButton.innerHTML = "";
  nyaaButton.setAttribute("href", "https://sukebei.nyaa.si/" + path + "#" + textFragment);
  nyaaButton.setAttribute("target", "_blank");
  nyaaButton.setAttribute("rel", "noopener");
  nyaaButton.setAttribute("title", "Search on Nyaa");
  nyaaButton.setAttribute("style", "margin-left: 10px;height: 10px;width: 10px;background-size: cover;display: inline-block;transform: scale(1.8);vertical-align: top;margin-top: 7px;");
  nyaaButton.style.backgroundImage = "url(data:image/jpeg;base64,)";
  titleElem.setAttribute("style", "display: inline-block;");

  titleElem.appendChild(nyaaButton);

})();